import React from 'react';
import './card.css';  // Import the CSS for the card

const Card = ({ data }) => {
    return (
        <div className="card">
            <h2>{data.name}</h2>
            <p>HP: {data.hp}</p>
            <img src={data.image_src} alt={data.name} />

            <p>{data.moves.join('\n')}</p>
        </div>
    );
}

export default Card;
